// src/neighborhoods.js
const neighborhoods = [
  {
    name: 'Neighborhood A',
    bounds: [
      { lat: 1.290270, lng: 103.851959 }, // SW corner
      { lat: 1.352100, lng: 103.819800 }  // NE corner
    ]
  },
  {
    name: 'Neighborhood B',
    bounds: [
      { lat: 1.352100, lng: 103.819800 }, // SW corner
      { lat: 1.430380, lng: 103.940230 }  // NE corner
    ]
  },
  // Add more neighborhoods as needed
];

export default neighborhoods;
